import React from 'react';

function CardTransactionModal(props) {
    return (
        <div className="modalWindow">
            <div className="title">
                <h2>
                    Зробити переказ
                </h2>
                <a onClick={props.cancelHandler}>
                    <i className="fa fa-close"></i>
                </a>
            </div>
        </div>
    );
}

export default CardTransactionModal;
